import {makeAutoObservable} from "mobx"
export default class InfoMain{
    constructor(){
        this._mainers = [
            {id: 1, name: 'Asik1', consum_el: 1000, cost: 200, profit: 0, expend: 0, img: 'defaut', work: true, serverId: 3},
            {id: 2, name: 'Asik2', consum_el: 1500, cost: 250, profit: 0, expend: 0, img: 'defaut', work: true, serverId: 3}
        ]
        this._uslov = {
            id: 2, cost_el: 0, cost_arend: 0
        }
        this._server = {
            id: 3, cost_object: 450, income: 0, uslovId: 2
        }
        this._user = {
            id: 1, email: 'fil@mail.ru', nikname: 'User', serverId: 3
        }
        makeAutoObservable(this)
    }

}
